7) Submit DNA sample and pay surcharge;
8) Spend sixty (60) days in jail, under the Huber Law to include on-site schooling, to commence upon the completion of sentence in 15 CF 738;
9) Pay restitution of $2,370.00 to Roger Ploederl, 1105 Victory Street, Two Rivers, WI 54241 and $1,627.24 to Manitowoc Parks & Recreation, 2655 S. 35th Street, Manitowoc, WI 54220, joint and several with Cody Spenser.  Restitution must be made at the minimum rate of $75.00 per month.   The defendant, if employed while serving the jail terms shall make a contribution from Huber earnings toward restitution after Huber fees are paid.   
